import React from "react";

const ResultTableItem = (props) => {
  return (
    <>
      <td>props.year</td>
      <td>props.yearlyInterest</td>
      <td>INTEREST GAINED IN YEAR</td>
      <td>TOTAL INTEREST GAINED</td>
      <td>TOTAL INVESTED CAPITAL</td>
    </>
  );
};

export default ResultTableItem;
